import React from 'react';

let count = 0;

const IncNum = () => {
    count++;
    console.log('click');
}

const App = () => {
    return(
        <>
            <h1> {count} </h1>
            <button onClick={IncNum}> Click Me </button>
        </>
    );
}

export default App;
